(24, 'Kepala Dinas Sosial Kota Tasikmalaya Memimpin Kegiatan Pemeriksaan dan Penyaluran Alat Bantu Dengar', '1.jpeg', 'DINSOS', '<p style=\"margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\">Jum’at 17/01/2020 –</span></div><div style=\"text-align: center;\"><span style=\"font-size: 1rem;\">Kepala Dinas Sosial Kota Tasikmalaya Drs. H. Nana Rosadi Apt.,M.Si, Memimpin kegiatan pemeriksaan dan Penyaluran alat bantu dengar kepada penyandang disabilitas yang berjumlah 14 orang melalui Yayasan Insan Siliwangi yangg diketuai oleh Guruh Prsetyo dan didampingi oleh Pendamping Penyandang Disabilitas PPD dari Kementrian Sosial Republik Indonesia.Sumber Bantuan dari Dirjen Rehabilitasi Sosial Kemensos RI.</span></div></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">( Lokasi : Dinas Sosial Kota Tasikmalaya)</p><p style=\"margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img class=\"size-medium wp-image-812 aligncenter\" src=\"http://dinsos.tasikmalayakota.go.id/wp-content/uploads/2020/01/WhatsApp-Image-2020-01-17-at-10.59.49-300x225.jpeg\" alt=\"\" width=\"300\" height=\"225\" srcset=\"http://dinsos.tasikmalayakota.go.id/wp-content/uploads/2020/01/WhatsApp-Image-2020-01-17-at-10.59.49-300x225.jpeg 300w, http://dinsos.tasikmalayakota.go.id/wp-content/uploads/2020/01/WhatsApp-Image-2020-01-17-at-10.59.49-768x576.jpeg 768w, http://dinsos.tasikmalayakota.go.id/wp-content/uploads/2020/01/WhatsApp-Image-2020-01-17-at-10.59.49-1024x768.jpeg 1024w, http://dinsos.tasikmalayakota.go.id/wp-content/uploads/2020/01/WhatsApp-Image-2020-01-17-at-10.59.49-800x600.jpeg 800w, http://dinsos.tasikmalayakota.go.id/wp-content/uploads/2020/01/WhatsApp-Image-2020-01-17-at-10.59.49-74x55.jpeg 74w, http://dinsos.tasikmalayakota.go.id/wp-content/uploads/2020/01/WhatsApp-Image-2020-01-17-at-10.59.49-111x83.jpeg 111w, http://dinsos.tasikmalayakota.go.id/wp-content/uploads/2020