INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(25, 'Dinas Sosial Kota Tasikmalaya Melaksanakan Kegiatan Pemberdayaan Potensi Sumber Kesejahteraan Sosial (PSKS)', 'judul.jpg', 'PEMBERSOS', '<p style=\"text-align: justify; \">Dinas Sosial Kota Tasikmalaya Bidang Pemberdayaan Sosial telah melaksanakan Kegiatan Pemberdayaan Potensi Sumber Kesejahteraan Sosial (PSKS) yang diikuti oleh 10 Tenaga Kesejahteraan Sosial Kecamatan (TKSK) dan 69 Pekerja Sosial Masyarakat (PSM) Kota Tasikmalaya yang diselenggarakan pada tanggal 06 November 2019 s.d 09 November 2019 yang diakhiri dengan kegiatan studi banding Ke Dinas Sosial Pemberdayaan Masyarakat dan Desa Kabupaten Banyumas – Jawa Tengah. Kegiatan ini bertujuan agar meningkatkan kualitas dan produktifitas tenaga kerja bagi Tenaga Kesejahteraan Sosial Kecamatan (TKSK) dan Pekerja Sosial Masyarakat (PSM) Kota Tasikmalaya.</p><p style=\"text-align: justify; \"><br></p><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"IMG20191108135117-768x576.jpg\" style=\"width: 767.995px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"IMG20191108153859-800x600.jpg\" style=\"width: 800px;\"></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"UPLOAD1-800x600.jpg\" style=\"width: 800px;\"></p><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"UPLOAD6-768x353.jpg\" style=\"width: 767.995px;\"></p><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"UPLOAD6-768x353.jpg\" style=\"width: 767.995px;\"></p><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"UPLOAD7-768x353.jpg\" style=\"width: 767.995px;\"><br></p><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"UPLOAD8-768x576.jpg\" style=\"width: 767.995px;\"></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><br></p>', '2020-08-08 06:09:12', '2020-08-08 06:09:12');
