(26, 'Dinas Sosial Kota Tasikmalaya Menyerahkan Bantuan Kepada Lanjut Usia', 'judul2.jpeg', 'REHSOS', '<p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><b>dinsostasikmalayakota 26/08/2019; Dinas Sosial Kota Tasikmalaya melaksanakan Program Rehabilitasi Sosial Bantuan Lanjut Usia (LU) dari Kementrian Sosial oleh pendamping kepada penerima manfaat lanjut usia di luar panti.<span style=\"font-size: 1rem;\">Adapun jumlah seluruh penerima manfaat sebanyak 48 orang se-Kota Tasikmalaya dengan pemberian bantuan sebesar Rp. 1.200.000 (satu juta duaratus ribu rupiah) yang diberikan langsung kepada Lanjut Usia</span><br></b></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-08-28-at-09.18.53-1-300x225.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-08-28-at-09.18.54-225x300.jpeg\" style=\"width: 225px;\"></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-08-28-at-09.18.55-300x225.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-08-28-at-09.18.541-300x225.jpeg\" style=\"width: 300px;\">&nbsp;</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">&nbsp; &nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-08-28-at-09.21.34-300x225.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-08-28-at-09.21.38-300x225.jpeg\" style=\"width: 300px;\"></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-08-28-at-09.21.42-300x225.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-08-28-at-09.21.43-300x225.jpeg\" style=\"width: 300px;\"><br></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><br></p>', '2020-08-08 06:54:56', '2020-08-08 06:54:56');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(27, 'Operasi Penertiban Gelandangan dan Pengemis di Jalanan Kota Tasikmalaya', 'WhatsApp-Image-2019-08-28-at-09.21.42-300x225.jpeg', 'REHSOS', '<h1 class=\"entry-title h1\" style=\"line-height: 1; margin-right: 0px; margin-bottom: 0px; margin-left: 0px;\"><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; line-height: 1;\"><span style=\"font-size: 18px;\">Dinas Sosial Kota Tasikmalaya Bidang Rehabilitasi Sosial Berkoordinasi dengan Satpol PP Kota Tasikmalaya melaksanakan kegiatan Operasi penertiban gelandangan dan pengemis (GEPENG) yang dilaksanakan pada Rabu 27 November 2019 di sekitar pusat jalanan Kota Tasikmalaya.</span><span style=\"font-size: 18px; color: inherit; font-family: inherit;\">Sejumlah 22 orang yang diantaranya anak jalanan, Gepeng berhasil diamankan dan digiring oleh petugas dan dibawa ke Rumah Singgah Dinas Sosial Kota Tasikmalaya untuk di Rehabilitasi dan diberikan bantuan, Pengarahan Pelatihan kewirausahaan agar tidak mengulangi hal tersebut.</span></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; line-height: 1;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-11-27-at-18.24.32-2-768x354.jpeg\" style=\"color: inherit; font-family: inherit; font-size: 2.5rem; width: 749.905px; height: 345.656px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-11-27-at-18.24.32-768x354.jpeg\" style=\"color: inherit; font-family: inherit; font-size: 2.5rem; width: 756.413px; height: 348.656px;\"></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; line-height: 1;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-11-27-at-18.24.33-768x354.jpeg\" style=\"width: 756.01px; height: 348.47px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-11-27-at-18.24.34-1-768x354.jpeg\" style=\"width: 760.086px; height: 350.349px;\">&nbsp;</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; line-height: 1;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-11-27-at-18.24.35-768x354.jpeg\" style=\"color: inherit; font-family: inherit; font-size: 2.5rem; width: 100%;\"></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; line-height: 1;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-11-27-at-18.47.57-138x300.jpeg\" style=\"width: 137.995px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-11-27-at-18.47.58-1-138x300.jpeg\" style=\"width: 137.995px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-11-27-at-18.47.59-1-138x300.jpeg\" style=\"width: 137.995px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2019-11-27-at-18.47.59-138x300.jpeg\" style=\"width: 137.995px;\"><span style=\"font-size: 14px; color: inherit; font-family: inherit;\"><br></span></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; line-height: 1;\"><span style=\"font-size: 14px; color: inherit; font-family: inherit;\"><br></span></p><div><br></div></h1>', '2020-08-08 07:02:56', '2020-08-08 07:57:22');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(28, 'Dinas Sosial Kota Tasikmalaya melakukan koordinasi dengang Kodim 0612', 'WhatsApp-Image-2019-11-27-at-18.24.32-2-768x354.jpeg', 'REHSOS', '<p style=\"text-align: justify; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">Koordinasi ini terkait tindak lanjut hasil FGD tentang penanganan anak PUNK JALANAN di kota Tasikmalaya, diwakili oleh Kepala Seksi Rehabilitasi Sosial Tuna Sosial dan Napza, pembahasan terkait teknis penanganan dan upaya rehabilitasi di lapangan dan sinergitas program dinas sosial dengan rencana pembentukan satgas.</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">Selasa 14/01/2020</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-14-at-16.05.50-1-300x138.jpeg\" style=\"width: 50%;\">&nbsp;</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-14-at-16.05.50-300x138.jpeg\" style=\"width: 50%;\">&nbsp;</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-14-at-17.17.33-300x138.jpeg\" style=\"width: 50%;\"><br></p>', '2020-08-08 07:25:31', '2020-08-08 07:25:31');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(29, 'Serah Terima 27 Pasien ODGJ Asal Kota Tasikmalaya Paska Rawat di RS. Marzoeki Mahdi Bogor', '20200106_171111-300x138.jpg', 'REHSOS', '<p style=\"text-align: justify; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; line-height: 1.5;\"><span style=\"font-size: 1rem;\">Tim Pelayanan Kesehatan Jiwa Masyarakat RSMM Membawa Kembali 27 Pasien Paska Rawat ke Kota Tasikmalaya, Dalam Kegiatan Pelayanan Kesehatan Jiwa Masyarakat dan Serah Terima 27 Pasien Paska Rawat RSMM ke Kota Tasikmalaya.</span><br></p><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; line-height: 1.5;\"><span style=\"font-size: 1rem;\">Dalam Serah Terima Pasien ini disambut&nbsp; Langsung oleh Bapak Wali Kota Tasikmalaya Drs. H. BUDI BUDIMAN, Bapak.Kepala Dinas Sosial Kota Tasikmalaya Drs. H. NANA ROSADI, A.Pt., M.Si, dan Bapak Kepala Dinas Kesehatan Kota Tasikmalaya, Beserta Keluarga Pasien yang Berasal Dari Kota Tasikmalaya Menyambut Dengan Penuh rasa Bahagia.</span></p><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; line-height: 1.5;\"><span style=\"font-size: 1rem;\">Pada tanggal 06 Januari 2020 yang bertempat di Aula kantor Dinas Kesehatan Kota Tasikmalaya dijadikan tempat untuk Serah Terima pasien tersebut, Bapak IYEP YUDIANA dari RS. Marzoeki Mahdi Bogor langsung Menyerahkan Kembali 27 Pasien Paska Rawat RSMM Kepada Bapak Wali Kota Tasikmalaya Drs. H. BUDI BUDIMAN, menuju Kota Tasikmalaya Jawa Barat dan Indonesia&nbsp; Bebas Pasung Tahun 2020, dan dibawa pulang oleh masing-masing Keluarga nya.Kegiatan ini Terselenggara atas Kerjasama RS.Dr.H. Marzoeki Mahdi Bogor Dengan Pemkot Tasikmalaya, Dinas Sosial Kota Tasikmalaya, Dinas Kesehatan Kota Tasikmalaya.</span></p><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px; line-height: 1.5;\"></p><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_171129-300x138.jpg\" style=\"\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_171133-300x138.jpg\" style=\"width: 300px;\"></div><div style=\"text-align: center;\">&nbsp;</div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_171139-300x138.jpg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_171232-300x138.jpg\" style=\"width: 300px;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_171238-300x138.jpg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_171450-300x138.jpg\" style=\"width: 300px;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_172002-300x138.jpg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_172532-300x138.jpg\" style=\"width: 300px;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_172628-300x138.jpg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_172639-300x138.jpg\" style=\"width: 300px;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"20200106_172532-300x138.jpg\" style=\"width: 460.592px; height: 211.865px;\"><br></div><div style=\"text-align: center;\"><br></div><p></p>', '2020-08-08 07:35:23', '2020-08-08 07:35:23');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(30, 'Kegiatan Focus Group Discussion (FGD) melakukan penandatanganan kesepakatan kesepahaman penanganan anak Punk Jalanan oleh Kepala Dinas Sosial Kota Tasikmalaya dengan Tema “Bisakah Anak Punk Berubah?.”', 'WhatsApp-Image-2020-01-09-at-15.18.18.jpeg', 'REHSOS', '<p></p><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">&nbsp;Kamis, (09/01/2020) bertempat di Resto Plaza Asia Kota Tasikmalaya.Dinas Sosial Mengikuti kegiatan Focus Group Discussion (FGD) dengan Tema “Bisakah Anak Punk Berubah?.” Dinas Sosial sebagai dinas teknis yg melaksanakan proses upaya rehabilitasi terhadap PMKS jalanan menjadi termasuk anak punk. Optimalisasi Rumah Singgah sangat diperlukan untuk kedepannya sebagai upaya memaksimalkan penanganan PMKS jalanan khususnya. Dan</span><span style=\"font-size: 1rem;\">Kepala Dinas Sosial Kota Tasikmalaya melakukan penandatanganan kesepakatan kesepahaman penanganan anak Punk Jalanan dalam acara FGD “Bisakah Punk Berubah” yg diprakarsai Forum Peduli Tasik (FPT) yg dihadiri oleh Walikota Tasikmalaya, Kapolres Kota Tasikmalaya, KODIM, DPRD kota dan Kabupaten tasikmalaya serta stakeholder yang lain.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-09-at-10.40.49-1-300x225.jpeg\" style=\"width: 430.829px; height: 323.115px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-09-at-10.40.50-300x225.jpeg\" style=\"width: 431.763px; height: 323.814px;\">&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-09-at-10.40.51-300x225.jpeg\" style=\"width: 431.992px; height: 323.984px;\">&nbsp;&nbsp;<span style=\"font-size: 1rem;\">&nbsp;</span><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-09-at-15.18.19-300x225.jpeg\" style=\"font-size: 1rem; width: 427.984px; height: 320.978px;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-09-at-15.18.17-768x384.jpeg\" style=\"width: 616.714px; height: 308.357px;\"><br></div><p></p>', '2020-08-08 07:57:06', '2020-08-08 10:00:56');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(31, 'Rehabilitasi sosial Berbasis Masyarakat (RBM) Karang Anyar Kec.Kawalu Kota Tasikmalaya bekerja sama dengan Dinas Sosial Melakukan Kegiatan “Pelayanan Terapi Anak Disabilitas”', 'WhatsApp-Image-2020-01-11-at-17.01.22-1.jpeg', 'REHSOS', '<p></p><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Sabtu (11/01/2020)&nbsp; Kegiatan Layanan Terapi anak Disabilitas di RBM Karang Anyar yang Bertempat di Mesjid Manarotul Ummah Saguling Panjang Kel.Cilamajang meliputi 4 wilayah yaitu : Cibeuti, Karang Anyar, Cilamajang, dan Talagasari Kecamatan Kawalu Kota Tasikmalaya. dan di Hadiri oleh Bapak Camat.Lurah, Babinsa, Babinmas, Dan Aparat Pemerintah Setempat. Kegiatan Layanan Terapi Anak Disabilitas yang Diselenggarakan di RBM Karang Anyar Bekerja sama dengan&nbsp;Dinas Sosial Kota Tasikmalaya, Puskesmas Karang Anyar, Lakpesdam NU, Klinik Harapan Bunda, dan RSUD dr. Soekardjo, Tim Terapis Fisioterapis,Terapi Wicara, Okupasi Terapi ( IFI, IKATWI, IOTI).</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Ada 44 anak Disabilitas yang mendapatkan Layanan Terapi, Dan 2 Orang Anak Disabilitas yang mendapatkan alat Bantu Kursi Roda, dan 1 alat Bantu Dengar dari Dinas Sosial Kota Tasikmalaya.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-11-at-16.59.54-300x225.jpeg\" style=\"width: 494.66px; height: 370.995px;\">&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-11-at-17.00.00-225x300.jpeg\" style=\"width: 225px;\">&nbsp; &nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-11-at-17.00.14-225x300.jpeg\" style=\"width: 225px;\">&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-11-at-17.00.18-300x225.jpeg\" style=\"width: 300px;\">&nbsp; &nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-11-at-17.00.21-300x225.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-11-at-17.00.34-300x225.jpeg\" style=\"width: 300px;\">&nbsp; &nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-11-at-17.00.39-300x225.jpeg\" style=\"width: 300px;\"><span style=\"font-size: 1rem;\"><br></span></div><p></p>', '2020-08-08 08:14:09', '2020-08-08 08:15:23');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(33, 'Rapat Koordinator Pembentukan Tim Reaksi Cepat (TRC) untuk Pemerlu Pelayanan Kesejahteraan Sosial (PPKS)', 'WhatsApp-Image-2020-02-20-at-22.40.06-5-300x138.jpeg', 'DINSOS', '<p style=\"margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"></p><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Dinas Sosial Kota Tasikmalaya Gelar Rakor Pembentukan Tim Reaksi Cepat (TRC) untuk Pemerlu Pelayanan Kesejahteraan Sosial (PPKS), tanggal 13 Februari 2020 Di Aula Balekota.Dihadiri oleh Ketua Dewan Komisi 4,Camat,Lurah,Dinkes,Satpol PP,TNI,Kepolisian,OPD terkait,TKSK,RBM,PSM,Tagana Kota Tasikmalaya,KPAD dan Stakeholder.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Tim Reaksi Cepat (TRC) Tim yang dibentuk oleh Dinas Sosial Kota Tasikmalaya untuk menangani kasus kasus yang terjadi secara cepat,khususnya Permasalahan Penyandang Masalah Kesejahteraan Sosial (PMKS) dalam Permensos Nomor 5 Tahun 2019 tentang DTKS menjadi Pemerlu Pelayanan Kesejahteraan Sosial (PPKS), Tim ini dibentuk berdasarkan SK Kepala Dina’s Sosial Kota Tasikmalaya sebagai gugus tugas terdepan dalam penanganan kasus-kasus permaslahan sosial.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Tim ini nanti nya akan melakukan pelayanan Dan pemberian perlindungan bagi Penyandang Masalah Kesejahteraan Sosial.Tujuan pembentukan TRC sebagai bentuk Pelayanan Publik secara Langsung kepada Masyarakat Dan penanganan PMKS lebih cepat dan terintegrasi.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Kepala Dinas Sosial Kota Tasikmalaya Drs.H.Nana Rosadi Apt.,M.Si mengatakan “TRC ini dibentuk supaya bisa menolong warganya yag sedang kesusahan, dengan cepat artinya Datang dengan Kesusahan pulang Bungah/Senang.Layanan TRC : Hotline Service, Pendampingan, Penjangkauan, Home visit, Reintegrasi dan Reunifikasi, Rujukan/Referal,Perlindungan di Rumah Aman Dan Layar Kusuma (Layanan Antar Keluarga Sampai ke Rumah).</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><p></p><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-14-at-17.44.26-1-300x138.jpeg\" style=\"\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-14-at-17.44.26-2-300x138.jpeg\" style=\"\">&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-14-at-17.44.26-3-300x138.jpeg\" style=\"\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-14-at-17.44.26-5-300x138.jpeg\" style=\"\">&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-14-at-17.44.26-6-300x138.jpeg\" style=\"\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-14-at-17.44.26-8-300x138.jpeg\" style=\"\">&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-14-at-17.44.26-300x138.jpeg\" style=\"\">&nbsp;<br></div>', '2020-08-08 10:09:20', '2020-08-08 10:12:05');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(34, 'Dinas Sosial Kota Tasikmalaya Menindak Lanjuti Kegiatan Rapat Koordinasi Tentang Penanganan Anak Punk', 'WhatsApp-Image-2020-02-14-at-17.44.26-8-300x138.jpeg', 'DINSOS', '<p style=\"margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">Dinas Sosial Kota Tasikmalaya mengikuti Kegiatan Rapat Koordinasi Tentang Penanganan Anak Punk Pada hari Jumat Tanggal 7 Februari 2020, di Kodim 0612 yang dihadiri oleh Walikota,Kepala Dinas Sosial Kota dan Kab. Asda, Sekda, Disduk, TKSK, KPAD, TNI,Kapolres,DPRD Kota dan Kabupaten, Stakeholder dan pegiat sosial lainnya.. Dalam Rakor tersebut dibahas tentang Pembentukan Satgas/Struktur Organisasi serta Alur, Sistem dan Program Penanganan Anak Punk. Dinas Sosial sebagai dinas pelaksana teknis yg melaksanakan proses upaya rehabilitasi terhadap PMKS jalanan termasuk anak punk. Dalam penanganan anak punk Dinas Sosial melalui LK3 melakukan pembinaan keluarga dan upaya Rehabilitasi Sosial bekerjasama dengan Satpol PP mengadakan kegiatan Penertiban Tuna Sosial setiap bulan.Hasil Penertiban tersebut dibina di Rumah Singgah di Data dan di Assesment.Untuk Punk yang sudah Dewasa Penanganan nya langsung oleh Satgas untuk mendapat Pembinaan dan Program Pelatihan dan untuk punk yg masih dibawah umur/ anak2 upaya penaanganan nya oleh Dinas Sosial bekerjasama dengan Lembaga Kesejahteraan Sosial Anak (LKSA) dan Pendampingan Psikososial.</p><p style=\"margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">Penanganan anak punk butuh dukungan semua pihak supaya penanganan nya lebih komprehensif dan berkelanjutan, dan Rakor ini sebagai Sinergitas semua pihak untuk mencari solusi penanganan nya. Dengan sinergitas semua elemen masyarakat dalam menangani permasalahan anak punk kedepan nya akan sadar dan berubah ke arah yang lebih baik.</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-08-at-15.52.24-1-300x138.jpeg\" style=\"width: 527.906px; height: 242.828px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-08-at-15.52.24-3-470x313.jpeg\" style=\"width: 470px;\"></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-08-at-15.52.24-4-470x313.jpeg\" style=\"width: 470px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-08-at-15.52.24-5-300x138.jpeg\" style=\"width: 517.784px; height: 238.172px;\"></p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><br></p>', '2020-08-08 10:21:28', '2020-08-08 10:21:28');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(35, 'Launching Program Bantuan Sosial Pangan (BSP) tahun 2020 di Kel.Tuguraja Kec.Cihideung Kota Tasikmalaya', 'WhatsApp-Image-2020-02-07-at-08.50.292.jpeg', 'DINSOS', '<p style=\"margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"></p><div style=\"text-align: justify;\"><div style=\"text-align: justify;\"><span style=\"font-size: 18px;\">&nbsp; &nbsp; &nbsp; Kepala Dinas Sosial Kota Tasikmalaya Drs.H. Nana Rosadi A.Pt.,M.Si ,Asda 1, Kabag Kesra, Polres Kota Tasikmalaya mendampingi Walikota Tasikmalaya Drs.H. Budi Budiman Membuka acara sekaligus simbolis Program Bantuan Sosial Pangan (BSP) tahun 2020 di Kel.Tuguraja Kec.Cihideung Kota Tasikmalaya.</span><span style=\"font-size: 18px;\">Kamis,06/02/2020-Tempat pelaksanaan KUBE E-Waroeng PKH Maslahat Kel.Tuguraja, Kec.Cihideung.&nbsp;</span><span style=\"font-size: 18px;\">Dalam kesempatan tersebut Walikota menyampaikan “Ini baru pertama louncing” kepada KPM, dan agar Penerima Manfaat lebih bersyukur mendapatkan bantuan tersebut yang mana pada tahun 2019 Bantuan Sosial Pangan tersebut senilai 110.000, dan sekarang menjadi 150.000/KPM.&nbsp;</span><span style=\"font-size: 18px;\">Jumlah KPM yang hadir dalam acara Lounching tersebut untuk wilayah Kel.Tuguraja sebanyak 600 KPM, dan dihadiri oleh TKSK Kec.Cihideung Kota Tasikmalaya, Pendamping PKH,PSM,Tagana Kota Tasikmalaya,Karang Taruna Kec.Cihideung Kota Tasikmalaya.</span></div></div><p></p><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-07-at-08.50.29-768x354.jpeg\" style=\"width: 767.995px;\">&nbsp; &nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-07-at-08.50.30-768x354.jpeg\" style=\"width: 767.995px;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-07-at-08.50.291-768x354.jpeg\" style=\"width: 767.995px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-07-at-08.50.293-768x354.jpeg\" style=\"width: 767.995px;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-07-at-08.50.294-768x354.jpeg\" style=\"width: 767.995px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-07-at-08.50.295-768x353.jpeg\" style=\"width: 767.995px;\">&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-07-at-08.50.296-768x353.jpeg\" style=\"width: 767.995px;\">&nbsp; &nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-07-at-08.50.297-768x354.jpeg\" style=\"width: 767.995px;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-07-at-08.50.298-768x354.jpeg\" style=\"width: 767.995px;\">&nbsp; &nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-07-at-08.50.301-768x354.jpeg\" style=\"width: 767.995px;\"><br></div>', '2020-08-08 10:37:12', '2020-08-24 18:55:55');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(36, 'Dinas Sosial Kota Tasikmalaya Merujuk Lansia Terlantar ke Rumah Perlindungan Sosial Provinsi Jawa Barat', 'WhatsApp-Image-2020-02-07-at-08.50.294-768x354.jpeg', 'DINSOS', '<p style=\"margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Jum’at 31 Januari 2020 -Dinas Sosial Kota Tasikmalaya melalui Bidang Rehabilitasi Sosial Merujuk Lansia Terlantar ke Rumah Perlindungan Sosial (Panti Rehabilitasi Sosial Lanjut Usia Provinsi Jawa Barat Tresna Werdha Garut). Lansia yang di rujuk bernama Bapak Hanan..Usia 71 Tahun..alamat Kp.Cijeruk Hilir Rt 02/RW 01 Kel. Cibeuti Kecamatan Kawalu..Bapak Hanan merupakan salah satu Lansia / Jompo</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">warga miskin yang tidak mempunyai rumah dan kondisinya memprihatinkan..untuk makan sehari2 nya dibantu oleh warga..RT, RW dan Tokoh Masyarakat setempat..Kehidupan sehari harinya hanya mengandalkan bantuan dari warga..oleh karena itu atas permintaan warga dan Rujukan dari Rt..Rw..Tokoh masyarakat..kelurahan, PSM dan TKSK..meminta bantuan ke Dinas Sosial Kota Tasikmalaya untuk menangani Lansia Terlantar dan Merujuk ke Panti Rehabilitasi Sosial Provinsi Jawa Barat Tresna Werdha Garut.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center; margin-left: 25px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-31-at-13.25.23-1-300x150.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-31-at-13.25.23-2-150x300.jpeg\" style=\"width: 150px;\">&nbsp;</div><div style=\"text-align: center; margin-left: 25px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-31-at-13.25.24-1-300x150.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-31-at-13.25.24-300x150.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;</div><div style=\"text-align: center; margin-left: 25px;\"><br></div><div style=\"text-align: center; margin-left: 25px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-31-at-13.25.25-300x150.jpeg\" style=\"width: 300px;\"><span style=\"font-size: 1rem;\"><br></span></div></p><div style=\"text-align: justify; \"><br></div>', '2020-08-08 10:41:09', '2020-08-08 10:41:09');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(37, 'Dinas Sosial Kota Tasikmalaya kunjungan kerja ke Kementrian Sosial Republik Indonesia', 'WhatsApp-Image-2020-01-30-at-20.33.57.jpeg', 'DINSOS', '<p style=\"text-align: justify; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">Bertempat di Kementrian Sosial Republik Indonesia Jl. Salemba Raya no.28, Jakarta Pusat. Pada hari Rabu s/d Kamis, 29-30 Januari 2020,Dinas Sosial Kota Tasikmalaya melakukan kunjungan kerja ke Kementrian Sosial Republik Indonesia dalam rangka Koordinasi dan Konsultasi :</p><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">1. Pusbang profesi Peksos &amp; Pensos Kemensos, Perihal : Koordinasi &amp; Konsultasi Tentang Jabatan Fungsional Pekerja Sosial &amp; Penyuluh Sosial serta Tentang Sertifikasi SDM Peksos &amp; Akreditasi LKS.</p><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">2. Kemensos RI, Perihal : Koordinasi &amp; Konsultasi Renstra dan Program Kegiatan.</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-30-at-20.33.57-1-300x225.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-30-at-20.33.57-3-300x211.jpeg\" style=\"width: 300px;\">&nbsp;</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-30-at-20.33.57-4-300x225.jpeg\" style=\"width: 300px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-30-at-20.43.13-300x208.jpeg\" style=\"width: 300px;\"><br></p>', '2020-08-08 10:43:27', '2020-08-08 10:43:27');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(38, 'Giat Walikota Tasikmalaya ke Dinas Sosial Kota Tasikmalaya', 'WhatsApp-Image-2020-01-21-at-13.56.24.jpeg', 'DINSOS', '<p><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Pembinaan Kepegawaian dan pembahasan kegiatan tahun 2020 di Lingkungan Dinas Sosial Kota Tasikmalaya di hadiri Wali Kota Tasikmalaya Drs. H. Budi Budiman, Sekdis Sosial, dan Seluruh ASN di lingkungan Dinas Sosial Kota Tasikmalaya.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Selasa 21/01/2020- bertempat di Aula Dinas Sosial Kota Tasikmalaya.</span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-21-at-13.56.24-2-300x138.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-21-at-13.56.24-4-300x138.jpeg\" style=\"width: 300px;\"></div><div style=\"text-align: center;\">&nbsp;&nbsp;</div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-21-at-13.56.24-5-300x138.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-21-at-13.56.24-6-300x138.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-21-at-13.56.24-7-300x138 (1).jpeg\" style=\"width: 300px;\">&nbsp; &nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-21-at-13.56.24-7-300x138.jpeg\" style=\"width: 300px;\"><span style=\"font-size: 1rem;\"><br></span></div></p>', '2020-08-08 10:46:06', '2020-08-08 10:46:06');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(39, 'Rapat Kordinasi Penanganan Penyandang Masalah Kesejahteraan Sosial (PMKS)', 'WhatsApp-Image-2020-01-20-at-13.08.01-5.jpeg', 'DINSOS', '<p style=\"text-align: justify; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">Wakil Walikota Tasikmalaya H. Muhammad Yusuf, Membuka acara kegiatan ini. Rakoor yang leading sektori oleh Bidang Rehabilitasi Sosial Dinas Sosial Kota Tasikmalaya, turut dihadiri pula oleh bidang lainnya, seperti Bidang Pemberdayaan Sosial, dan perlindungan dan jaminan sosial. Kepala Dinas Sosial Drs. H. Nana Rosadi Apt.,M.Si, memberikan pemaparan materi tentang penanganan PMKS tersebut kepada peserta yg terdiri dari OPD terkait, Camat, Lurah Se-Kota Tasikmalaya, dan Tenaga Kesejahteraan Sosial Kecamatan (TKSK).</p><p style=\"text-align: justify; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\">Acara ini Diselenggarakan oleh Dinas Sosial Kota Tasikmalaya,Senin 20/01/2020- Bertempat di Gedung Serba Guna Kota Tasikmalaya.</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-20-at-13.08.01-3-300x138.jpeg\" style=\"width: 300px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-20-at-13.08.01-6-300x138.jpeg\" style=\"width: 300px;\">&nbsp;</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-20-at-13.08.01-7-300x138.jpeg\" style=\"width: 300px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-20-at-13.08.01-8-300x138.jpeg\" style=\"width: 300px;\">&nbsp;</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-20-at-13.08.01-9-300x138.jpeg\" style=\"width: 300px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-20-at-13.08.01-11-300x138.jpeg\" style=\"width: 300px;\">&nbsp;</p><p style=\"text-align: center; margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-20-at-13.08.01-300x138.jpeg\" style=\"width: 300px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-01-20-at-14.01.26-300x138.jpeg\" style=\"width: 300px;\"><br></p>', '2020-08-08 10:48:48', '2020-08-08 10:48:48');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(40, 'Musyawarah Perencanaan Pembangunan(MUSRENBANG) Sektoral Dinas Sosial Kota Tasikmalaya', 'WhatsApp-Image-2020-01-20-at-13.08.01-9-300x138.jpeg', 'DINSOS', '<p style=\"margin-right: 0px; margin-bottom: 3rem; margin-left: 0px;\"></p><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\"><div><span style=\"font-size: 14px;\">Pada hari Kamis,20/02/2020-bertempat di Grand Metro Hotel Jl.Kh.Zaenal Mustofa Musyawarah Perencanaan Pembangunan (Musrenbang) Sektoral Dinas Sosial Kota Tasikmalaya dihadiri oleh Wakil Walikota Tasikmalaya Drs. Muhammad Yusuf sekaligus membuka acara dengan resmi Kegiatan Musyawarah Rencana Pembangunan Sektoral Dinas Sosial Kota Tasikmalaya tahun 2021 dengan Tema “Peningkatan Sasaran Penerima Bantuan Sosial yang tepat dengan Menggunakan Data Terpadu Kesejahteraan Sosial”</span></div><div><span style=\"font-size: 14px;\">Musyawarah Perencanaan Pembangunan Sektoral Dinas Sosial Kota Tasikmalaya membahas Prioritas Program dan Kegiatan Pembangunan melalui Koordinasi antar Intansi Pemerintah dan Partisipasi seluruh pelaku pembangunan.</span></div><div><span style=\"font-size: 14px;\">Kepala Dinas Sosial Kota Tasikmalaya Drs. H. Nana Rosadi A.Pt.,M.Si bertujuan menyelaraskan program dan kegiatan prioritas Pembangunan Daerah sebagai satu kesatuan sistem Perencanaan setelah Musrenbang tingkat Kelurahan,Tingkat Kecamatan untuk Disinkronisasikan pada Musrenbang Tingkat Kota Tasikmalaya.</span></div><div><span style=\"font-size: 14px;\">Terimakasih juga kepada Komisi 4 DPRD Kota Tasikmalaya, Bapelitbangda,seluruh pengaku kepentingan dan para Tamu Undangan yang telah hadir untuk Mensukseskan acara Musrenbang Sektoral Dinas Sosial Kota Tasikmalaya.</span></div></div><p></p><div style=\"text-align: center;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.38.17.jpeg\" style=\"width: 651.992px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.38.17-1.jpeg\" style=\"width: 650px;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.38.17-2-300x221.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.38.17-7-470x313.jpeg\" style=\"width: 470px;\">&nbsp;&nbsp;</div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.38.17-8-470x313.jpeg\" style=\"width: 470px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.38.17-9-470x313.jpeg\" style=\"width: 470px;\">&nbsp;&nbsp;</div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.38.17-10-470x313.jpeg\" style=\"width: 470px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-23.06.43-300x138.jpeg\" style=\"width: 300px;\"></div><div style=\"text-align: center;\"><br></div>', '2020-08-08 10:53:00', '2020-08-23 21:03:07');
INSERT INTO `artikel` (`artikel_id`, `judul`, `gambar`, `kategori`, `isi`, `created_at`, `updated_at`) VALUES
(41, 'Penertiban Anak Jalanan yang ada di Kota Tasikmalaya', 'WhatsApp-Image-2020-01-11-at-17.00.34-300x225.jpeg', 'DINSOS', '<p></p><div style=\"text-align: justify;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: &quot;Times New Roman&quot;, serif;\">Pada hari Rabu,Tanggal\r\n19 Februari 2020 Dinas Sosial Kota Tasikmalaya Bidang Rehabilitasi Sosial\r\nmenyelanggarakan penertiban bersama Satpol PP diantaranya menertibkan anak\r\njalanan, gepeng, dan anak punk. Hasil penertiban tersebut diantaranya anak punk\r\n8 orang, laki-laki 4 orang, dan perempuan 4 orang. Sedangkan gepeng sebanyak 26\r\norang, laki-laki 17 orang, perempuan 7 orang, dan balita 4 orang.&nbsp;</span><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 14pt;\">Kepala Dinas Sosial\r\nKota Tasikmalaya Drs. H. Nana Rosadi A.Pt.,M.Si memberikan pengarahan\r\npenertiban kepada Satpol PP. Bekerjasama dengan Puskesmas Tamansari untuk\r\nMengadakan pemeriksaan kesehatan Dan tes HIV/AID kepada Pesert hasil\r\nPenertiban,Sedangkan BNN memeriksa / cek Narkoba kepada anak Punk dan Anjal.\r\nSekretaris Dinas Sosial Hendra Budiman Raksanagara S.Pi,Kabid Rehabilitasi\r\nSosial Beti Badrawati SH.MH,Kasie Tuna Sosial dan Napza Hj.Ningning memberikan\r\npengarahan kepada Anak Jalanan tersebut. Khususnya anak punk yang berjumlah 8\r\norang akan dibina dulu dirumah singgah selama 3 hari.</span></p><span style=\"font-size: 14pt;\">\r\n\r\n</span><span style=\"font-size: 1rem;\"><div><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;\">&nbsp;</span><span style=\"font-size: 1rem;\">&nbsp; &nbsp; &nbsp;</span><br></div></span></div><div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\"><br></span></div><div><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.40.05-1-300x138.jpeg\" style=\"\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.40.05-3-300x138.jpeg\" style=\"width: 300px;\">&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.40.06-2-300x138.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.40.06-3-300x138.jpeg\" style=\"width: 300px;\">&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.40.06-4-300x138.jpeg\" style=\"width: 300px;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.40.06-5-300x138.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.40.06-6-300x138.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.40.06-300x138.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;</div><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\">&nbsp; &nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.49.28-300x138.jpeg\" style=\"width: 300px;\">&nbsp;&nbsp;<img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp-Image-2020-02-20-at-22.52.01-300x138.jpeg\" style=\"width: 300px;\">&nbsp;<span style=\"font-size: 1rem;\"><br></span></div><p></p>', '2020-08-09 18:57:30', '2020-08-09 20:06:38');

